import logo from './logo.svg';
import './App.css';
import campfireBackground from './assets/campfire-background.png';

function App() {
  return (
    <div className="App"
        style={{
          backgroundImage: `url(${campfireBackground})`
        }}>
    </div>
  );
}

export default App;
